import "./App.css";
import BookingPanel from "./components/Booking";
import Hero from "./components/Hero";
import About from "./components/About";
import Nav from "./components/Navbar";

function App() {
	return (
		<div className="App">
			<Nav></Nav>
			<Hero></Hero>
			<About></About>
			<BookingPanel></BookingPanel>
		</div>
	);
}

export default App;
